Director: Bud Lee
Starring: Asia Carrera, Christina West, Kelly Jaye, Krista, Kylie Ireland, Buck Adams, Jon Dough, Nick East, Steven St. Croix.

Kelly Jaye has special powers and not just over your shorts. Shes a healer; in a sexual sense. She meets Jon Dough and, with a little help from an angel in disguise as Christina West, has his pants down and his spirits up in no time. Then, Nick East gives nurse Krista a flesh enema. Kelly and Asia Carrera do a numbing girl/girl, and youre left shivering with lust like a fevered puppy. The Florence Nightengale of sex is here.
